import './App.css';
import PizzaHurt from './components/PizzaHurt';

function App() {
  return (
    <>
     <nav className="nav navbar-brand bg-dark text-success text-center">
      <a href="/" className="navbar-brand" alt="image">redux</a>
     </nav>
     <PizzaHurt />
    </>
  );
}

export default App;
